import {React, useState} from "react";


const Count = () => {
    useState[count,setCount] = useState(30)
    const handlerCount = () => {
        setCount(prevCount => prevCount -1)
    }
    return (
        <>
            <div>
                <h1>Count: {count}</h1>
            </div>
            <button onClick={handlerCount}>Click me!</button>
        </>
    )

}

export default Count
